body {
  background-color: rgba(255, 255, 255, 0.9);
  backdrop-filter: blur(384.02px);
}

header {
  display: flex;
  align-items: center;
  justify-content: space-around;
}

ul {
  display: flex;
}

li {
  list-style-type: none;
  margin-left: 20px;
  color: black;
}
a {
  text-decoration: none;
  font-family: "Cera Pro";
  font-style: normal;
  font-weight: 400;
  font-size: 16.7159px;
  line-height: 21px;
  /* identical to box height */

  text-transform: uppercase;

  color: #686c75;
}

